create table V)OR (
	V)OR_NO integer not null,
	NAME VARCHAR(50) null,
        STREET VARCHAR(30),
        CITY VARCHAR(12),
        STATE CHAR(2),
        ZIP integer,
	TEL_NO VARCHAR(12) null, 
	constraint V)OR_PK primary key (V)OR_NO) ) ;

 

create table TAX (
	TAX_NO integer not null,
	STATE CHAR(2) null,
	TAX_RATE decimal(10,4) null, 
	constraint TAX_PK primary key (TAX_NO) ); 



create table PRODV)OR (
    	PO_NO integer not null,
	V)OR_NO integer null,
	PRODUCT_NO integer not null,
	ORDER_DATE date null,
	EXPECTED_RECVD_DATE date null,
	ACTUAL_RECVD_DATE date null,
	V)_QTY integer null,
	DPRICE CHAR(10) null,
	CONSTRAINT PRODV)OR_PO_NO_PK PRIMARY KEY (PO_NO)); 


create table QTYDISCOUNT (
	QTYDISCOUNT_NO integer not null,
	D_PRICE integer null,
	MIN_QTY integer null,
	MAX_QTY CHAR(10) null,
	PRODUCT_NO integer null,
	constraint QTYDISCOUNT_PK primary key (QTYDISCOUNT_NO) ); 



create table RETURNPROD (
        ORDERLINE_NO integer , 
        RETR_QTY integer ,
	RETURN_ID integer not null,	
	DATE_RETURNED DATE not null,
        AMOUNT_REFUNDED integer ,
        RETURN_CODE integer ,
	constraint RETURNPROD_RETURNID_PK primary key (RETURN_ID));









create table PRODUCT (
	PRODUCT_NO integer not null,
	BRAND VARCHAR(15) null,
	CLASS VARCHAR(20) null,
	PRODUCT_DESCRIPTION VARCHAR(50) null,
	UNIT_PRICE integer null,
	UNIT_COST integer null,
	PRODUCT_CATEGORY VARCHAR(15) null,
	QOH integer null,
	ORDER_LEVEL integer null,
	ORDER_QTY integer null,
	BACK_ORDER integer null,
	AVAIL_DATE DATE null,
	DAMAGED_QTY integer null, 
	constraint PRODUCT_PRODUCTNO_PK primary key (PRODUCT_NO) ); 



create table ORDERS (
	ORDER_NO integer not null,
	ORDER_DATE DATE not null,
	SHIP_DATE DATE null,
	SHIPPING_METHOD VARCHAR(12) null,
	TAX_STATUS CHAR(1) null,
	SUBTOTAL integer null,
	TAX_AMT integer null,
	SHIPPING_CHARGE integer null,
	TOTAL_AMT integer null,
	CUSTOMER_NO integer null,
	EMPLOYEE_NO integer null,
	BRANCH_NO integer null,
	constraint ORDERS_ORDERNO_PK primary key (ORDER_NO) ); 

select substr(order_date,4,3)
from orders


create table ORDERLINE (
	ORDERLINE_NO integer not null,
	PRODUCT_NO integer null,
	QTY integer null,
	ORDER_NO integer null, 
	constraint ORDERLINE_ORDERLINENO_PK primary key (ORDERLINE_NO) ); 







create table BRANCH (
	BRANCH_NO integer not null,
	STREET VARCHAR(30) null,
	CITY VARCHAR(15) not null,
	STATE VARCHAR(2) ,
        REGION_NO integer ,
	ZIP integer null constraint BRANCH_ZIP_CHK check ( ZIP > 0 ) , 
	constraint BRANCH_BRANCHNO_PK primary key (BRANCH_NO) );




create table PROMOTION (
	PROMOTION_NO integer not null,
	P_PRICE integer null,
	START_DATE DATE null,
	)_DATE DATE null,
	PRODUCT_NO integer null, constraint PROMOTION_PK primary key (PROMOTION_NO) ); 


create table PRODUCTSET (
	PRODUCT_NO integer not null,
	PRODUCTSET_NO integer not null,
	PROD_QTY integer null, 
	constraint PRODUCTSET_PK primary key (PRODUCTSET_NO, PRODUCT_NO) ); 



create table V)ORPRICE (
	VPRICE_NO integer not null,
	V)OR_NO integer not null,
	PRODUCT_NO integer not null,
	VPRICE integer not null,
	DISCOUNT integer null,
	START_DATE DATE null,
	)_DATE DATE null, constraint V)ORPRICE_PK primary key (VPRICE_NO) ); 



CREATE TABLE backorder(
	backorder_no integer ,
	product_no integer,
	bo_qty integer,
	bo_date date,
	CONSTRAINT backorder_backorderno_pk PRIMARY KEY (backorder_no));


CREATE TABLE EMPLOYEE(
EMPLOYEE_NO integer not null,
LNAME VARCHAR(12) NOT NULL ,
FNAME VARCHAR(12) ,
STREET VARCHAR(30),
CITY VARCHAR(15),
STATE VARCHAR(2),
ZIP integer ,
STATUS integer ,
DOB DATE NOT NULL ,
START_DATE  DATE ,
)_DATE DATE ,
BRANCH_NO integer NOT NULL ,
BRANCH_SIZE VARCHAR(30),
POSITION integer ,
RATE integer ,
COMMISSION integer ,
CONSTRAINT EMPLOYEE_BRANCH_NO_FK FOREIGN KEY (BRANCH_NO) REFERENCES BRANCH (BRANCH_NO),
CONSTRAINT EMPLOYEE_NO_PK PRIMARY KEY (EMPLOYEE_NO));




CREATE TABLE CUSTOMER(
CUSTOMER_NO integer not null,
LNAME VARCHAR(12),
FNAME VARCHAR(12),
STREET VARCHAR(30),
CITY VARCHAR(15),
STATE VARCHAR(2),
ZIP integer,
REGION_NO integer,
TEL_NO VARCHAR(15) ,
BALANCE integer ,
CREDIT_LIMIT integer ,
BRANCH_NO integer null,	
CONSTRAINT CUST_NUM_PK PRIMARY KEY (CUSTOMER_NO));
--CONSTRAINT CUSTOMER_BRANCH_NO_FK FOREIGN KEY (BRANCH_NO) REFERENCES BRANCH (BRANCH_NO)) ;


create table employee_position (
        position integer not null , 
        description varchar(40) ,
    CONSTRAINT employee_position_pk  primary key (position));



create table employee_status (
         status integer not null , 
         description varchar(40) ,
         CONSTRAINT employee_status_pk primary key (status));


create table regions (
        region_no integer not null , 
        timezone varchar(40) ,
        CONSTRAINT regions_pk primary key (region_no));


create table region_state (
            state varchar(30) not null ,
            abbreviation varchar(2) not null ,
            city varchar(40) not null , 
            zip integer not null ,
            region_no integer ,
CONSTRAINT region_state_fk FOREIGN KEY (region_no) references regions(region_no));




create table timedimension (
            day integer ,
            month varchar(3) ,
            quarter integer ,
            year integer ) ;


create table salary(
      position integer not null , 
      branch_size varchar(30) not null , 
      salary integer not null ) ;




create table return_category (
       return_code integer not null , 
       description varchar(40) );




create table state_capital (
             city varchar(40) not null , 
             state varchar(2) not null , 
             zip integer , 
             region_no integer);



select product_category, product_description,
 max(decode( month,'JAN', gross , 0 )) AS gross_Jan,
 max(decode( month,'JAN', gross , 0 )) AS return_Jan,
 max(decode( month,'JAN', gross , 0 )) AS net_Jan,
 max(decode( month,'FEB', return , 0 )) AS gross_Feb,
 max(decode( month,'FEB', return , 0 )) AS return_Feb,
 max(decode( month,'FEB', return , 0 )) AS net_Feb,
 max(decode( month,'MAR', total , 0 )) AS gross_Mar,
 max(decode( month,'MAR', total , 0 )) AS return_Mar,
 max(decode( month,'MAR', total , 0 )) AS net_Mar,
 max(decode( month,'APR', gross , 0 )) AS gross_Apr,
 max(decode( month,'APR', gross , 0 )) AS return_Apr,
 max(decode( month,'APR', gross , 0 )) AS net_Apr,
 max(decode( month,'MAY', return , 0 )) AS gross_May,
 max(decode( month,'MAY', return , 0 )) AS return_May,
 max(decode( month,'MAY', return , 0 )) AS net_May,
 max(decode( month,'JUN', total , 0 )) AS gross_Jun,
 max(decode( month,'JUN', total , 0 )) AS return_Jun,
 max(decode( month,'JUN', total , 0 )) AS net_Jun,
 max(decode( month,'JUL', gross , 0 )) AS gross_Jul,
 max(decode( month,'JUL', gross , 0 )) AS return_Jul,
 max(decode( month,'JUL', gross , 0 )) AS net_Jul,
 max(decode( month,'AUG', return , 0 )) AS gross_Aug,
 max(decode( month,'AUG', return , 0 )) AS return_Aug,
 max(decode( month,'AUG', return , 0 )) AS net_Aug,
 max(decode( month,'SEP', total , 0 )) AS gross_Sep,
 max(decode( month,'SEP', total , 0 )) AS return_Sep,
 max(decode( month,'SEP', total , 0 )) AS net_Sep,
 max(decode( month,'OCT', gross , 0 )) AS gross_Oct,
 max(decode( month,'OCT', gross , 0 )) AS return_Oct,
 max(decode( month,'OCT', gross , 0 )) AS net_Oct,
 max(decode( month,'NOV', return , 0 )) AS gross_Nov,
 max(decode( month,'NOV', return , 0 )) AS return_Nov,
 max(decode( month,'NOV', return , 0 )) AS net_Nov,
 max(decode( month,'DEC', total , 0 )) AS gross_Dec,
 max(decode( month,'DEC', total , 0 )) AS return_Dec,
 max(decode( month,'DEC', total , 0 )) AS net_Dec,
 sum(total) as total
from 	(select substr(order_date,4,3) as month, product_category, product_description, 
            sum((qty * unit_price) + tax + shipping) as gross, 
            NVL(sum(retr_qty * unit_price), 0) as return, 
            sum(shipping) as shipping, 
            sum(tax) as tax, 
            sum((unit_price * net_qty) + tax + shipping) as total
    from	(select order_date, product_category, product_description, 
                (qty - NVL(retr_qty, 0)) net_qty, 
                    qty, 
                retr_qty, unit_price, shipping, tax
            from	(
                select 	order_date, 
                    product_category, 
                    product_description, 
                    orderline_no, 
                    qty, 
                    unit_price, 
                    NVL(shipping_charge, 0) as shipping, 
                    NVL(tax_amt, 0) as tax
            from orders o, orderline ol, product p
            where o.order_no = ol.order_no
            AND ol.product_no = p.product_no
            ) base 
            FULL JOIN 
            (select ol.orderline_no, sum(retr_qty) as retr_qty
            from orderline ol, returnprod rp
            where ol.orderline_no = rp.orderline_no
            group by ol.orderline_no, qty) return
            on 	base.orderline_no = return.orderline_no
            order by base.orderline_no)
            group by substr(order_date,4,3), product_category, product_description
      )
group by product_category, product_description
order by total desc;














